public class MADummyModel implements IMAModel {
    public static final String TAG = "MADummyModel";

    public MADummyModel() {
    }

    @Override
    public int getProfileCount() {
        return 1;
    }

    @Override
    public void saveProfile(ProfileWithPosts profile) {
        // TODO
    }

    @Override
    public ProfileWithPosts obtainProfile(Long id) {
        ArrayList<Post> posts = new ArrayList<>();
        posts.add(getDummyPost());

        ProfileWithPosts profile = new ProfileWithPosts(id, getBase64ProfilePicture(), "Michael Bortlik", 27, "Wirtschaftsinformatik", Gender.MALE, posts);
        return profile;
    }



    private static String encodeToBase64(Bitmap image, Bitmap.CompressFormat compressFormat, int quality) {
        ByteArrayOutputStream byteArrayOS = new ByteArrayOutputStream();
        image.compress(compressFormat, quality, byteArrayOS);
        return Base64.encodeToString(byteArrayOS.toByteArray(), Base64.DEFAULT);
    }

    private Post getDummyPost() {
        ArrayList<Comment> comments = new ArrayList<>();
        comments.add(getDummyComment());
        Post post = new Post(1, null, "Example Post", "aus Regensburg", comments);
        return post;
    }

    private Comment getDummyComment() {
        Profile profile = new Profile(1, getBase64ProfilePicture(), "Michael Bortlik", 27, "Wirtschaftsinformatik", Gender.MALE);
        Comment comment = new Comment(profile, "example comment", null, "aus Regensburg");
        return comment;
    }

    @Override
    public boolean sendComment(Long postId, String commentText, String base64Picture, Long latitude, Long longitude) {
        Random random = new Random();
        return random.nextBoolean();
    }
    private String getBase64ProfilePicture() {
        return StringUtils.join(new String [] {
                "",
                "","","","","","","","","","","","",""
        });

    }

}
